#include <iostream>
#include <vector>
#include <set>
using namespace std;

class Solution {
public:
    vector<string> findRepeatedDnaSequences(string s) {
        if (s.size() < 10) {
            return {};
        }
        set<string> r, f;
        for (int i = 0; i <= s.size() - 10; i++) {
            string sub = s.substr(i, 10);
            if (f.count(sub)) {
                if (r.count(sub) == 0) {
                    r.insert(sub);
                }
            } else {
                f.insert(sub);
            }
        }
        return vector<string>(r.begin(), r.end());
    }
};

int main() {
    Solution sol;
    string s = "AAAAACCCCCAAAAACCCCCCAAAAAGGGTTT";
    //string s = "AAAAAAAAAAA";
	//string s = ""; string s = "";
    vector<string> r = sol.findRepeatedDnaSequences(s);
    for (string sub : r) {
        cout << sub << endl;
    }
    return 0;
}